import React, { Component } from "react";
import { NavLink, Link } from "react-router-dom";

import "react-toastify/dist/ReactToastify.css";

import LogoBlackIcon from "../../../assets/home/Logo_black.png";

import {
  NavContainer,
  BtnContainer,
  BtnP,
  NavBtn,
  Row,
  ClosedBtn,
  AlertTitle,
  AlertContent,
  LogoContainer,
  Nav2Container,
  NavRight,
  NoticeBtn,
  UserInfoContainer,
  UserName,
  UserDepartment,
  MoreInfo,
  HomeNav,
  NavItem,
  NavClickItem,
  AuthBox,
  MoveBtn,
} from "./navbar.style";

const active = {
  fontSize: "13.5px",
  fontFamily: "NanumSquareB",
  cursor: "pointer",
  width: "80px",
  height: "33px",

  display: "flex",
  justifyContent: "center",
  alignItems: "center",

  border: "1px solid var(--greenish-teal)",
  borderRadius: "16.5px",
  outline: "none",

  color: "var(--greenish-teal)",
};

const Navbar = () => {
  return (
    <div>
      <HomeNav>
        <img
          src={LogoBlackIcon}
          width="129px"
          height="40px"
          style={{ marginRight: "338px" }}
        />
        <AuthBox style={{ marginLeft: "57px" }}>
          <NavBtn to="/auth/signIn">로그인</NavBtn>

          <NavBtn to="/auth/signUp" style={{ marginLeft: "7px" }}>
            회원가입
          </NavBtn>
        </AuthBox>
      </HomeNav>
    </div>
  );
};

export default Navbar;
